import React, { Component } from 'react'

export default class ExpandedBox extends Component {
  render() {
    const item = this.props.item
    const color = this.props.item.color
    return (
      <div className="expandedBox" ref={this.props.projectDetails} style={{borderTopColor: color, borderBottomColor: color}}>
        <h2>{item.title}</h2>


      </div>
    )
  }
}
